import { useState } from 'react';

function Home(){
    return (
        <div> 
        <h2>Contador</h2>
        <Contador />
        </div>
    )
}

function Contador(){
    const [contador,setContador] = useState(1);

    function adicionarContador(){
        setContador(contador + 1);
    }

    return (
        <div>
            <div>{contador}</div>
            <button onClick={adicionarContador}>Add</button>
        </div>
     
    )
    
}

export default Home
